function Movie({title, medium_cover_image, summary, genres}) {

    return (
        <div>
            <h2>{title}</h2>
            <img src={medium_cover_image} alt={title}></img>
            <p>{summary}</p>
            <ul>
            {genres.map((g) => (
                <li key={g}>{g}</li>
                ))}
            </ul>
        </div>
    )
}

export default Movie;
